//消息时间
function formatTimeStamp(time) {
    if (time == null) return;
    var spanTime = '';
    var s = Math.floor(Math.round(new Date().getTime() / 1000) - time);
    if (s < 60) {
        spanTime = '刚刚';
    } else if (s > 60 && s < 3600) {
        spanTime = Math.floor(s / 60) + '分钟前';
    } else if (s / 3600 < 24) {
        //spanTime=Math.floor(s/3600)+'小时前'
        spanTime = webim.Tool.formatTimeStamp(time).substring(11, 16);
    } else if (s / 3600 / 24 == 1) {
        spanTime = '昨天';
    } else if (s / 3600 / 24 > 1) {
        spanTime = webim.Tool.formatTimeStamp(time).substring(0, 10);
    }
    return spanTime;
}
